QuestionText:
boolean a = false;
// ifの条件がダメだったときに実行する命令を(****)に書いてね
if (a) {
    System.out.println("A");
} (****) {
    System.out.println("Not A");
}

int x = 7;
// 最初の条件がダメで、別の条件(x>5)を調べる命令を(****)に書いてね
if (x > 10) {
    System.out.println("Large");
} (****) (x > 5) {
    System.out.println("Medium");
}

int score = 80;
// 最初の条件がダメで、次の条件(score > 70)を調べる命令を(****)に書いてね
if (score > 90) {
    System.out.println("S");
} (****) (score > 70) {
    System.out.println("A");
}

int p = 2;
// pが1ではなく、2の場合を調べる命令を(****)に書いてね
if (p == 1) {
    System.out.println("One");
} (****) (p == 2) {
    System.out.println("Two");
}

boolean isValid = false;
// isValidがfalse(ダメ)なときに実行する命令を(****)に書いてね
if (isValid) {
    System.out.println("Valid");
} (****) {
    System.out.println("Invalid");
}

int temp = 25;
// 30以下だけど、20より大きい場合を調べる命令を(****)に書いてね
if (temp > 30) {
    System.out.println("Hot");
} (****) (temp > 20) {
    System.out.println("Warm");
}

int mode = 2;
// modeが1じゃなくて2の場合を調べる命令を(****)に書いてね
if (mode == 1) {
    System.out.println("Mode 1");
} (****) (mode == 2) {
